import React, { Component } from 'react';
import './index.css';

import Icons from './components/Icons/IconContainer';
import Signature from './components/Layout/Signature'


export default 
class App extends Component {
  state = {
    pomodoro: false
  }

  render() {
    return (
      <div 
        style = {{
          height: '100vh',
          width: '100vw',
          background: 'linear-gradient(to bottom right, #090a0a 55%, #151617 55%)',
          color: 'white',
          display: 'flex',
          justifyContent: 'space-between'
        }}
      >
        <div style = {{
          display: 'flex',
          flexDirection: 'column',
          justifyContent: 'space-between',
          height: '100%',
          padding: '2.5%'
        }}>
          <Icons />
        </div>
        <div style = {{
          width: '20vw',
          margin: '10px'
        }}>
          <Signature />
        </div>
      </div>
    );
  }
}
